def change_in_cart(r, phi): 
        """
        Convert polar coord. to cartisian coord.

        inputs:
        r - radius
        phi - angle

        Outputs:
        [x - position, y - position]

        """
        cart = [r * math.cos(phi), r * math.sin(phi)]
        return cart





