import matplotlib.pyplot as plt
import numpy as np



def density_calculation(percentage):
        a = 1e-10
        diatomic_molar_mass = 39.948 * 2
        diatomic_mass = diatomic_molar_mass/(6.022*(10**23))
        m = diatomic_mass/1000
        sigma = (3.4 * 10 ** (-10))
        N = 100
        length_molecule_x = (a + sigma * 2) * math.sqrt(N)
        length_molecule_y = (2 * sigma) * math.sqrt(N)
        sb_x = (length_molecule_x * (percentage)/100)
        sb_y = (length_molecule_y * (percentage)/100)
        density = (m * N)/(sb_x * sb_y)
        return density

def no_negative_val(dt, lp):
        n = 0
        new_dt = []
        new_lp = []
        while n < len(lp):
                if lp[n] > 0:
                        new_dt.append(dt[n])
                        new_lp.append(lp[n])
                else:
                        break
                n += 1
        return [new_dt, new_lp]

def no_negative_val_v(dt, v_corr):
        n = 0
        new_dt = []
        new_v_corr = []
        while n < len(v_corr ):
                if v_corr[n] * -1 > 0:
                        new_dt.append(dt[n])
                        new_v_corr.append(v_corr[n] * -1)
                else:
                        break
                n += 1
        return [new_dt, new_v_corr]

def flip_v_corr(v_corr):
        i = 0
        new_v_corr = []
        while i < len(v_corr):
                #temp_v_corr = ((v_corr[i]) * -1) + 1
                new_v_corr.append(((v_corr[i] - 1) * -1))
                i += 1
        return new_v_corr



def Quick_graph_legendre_polynomial(analysied_data, density):
        dt = analysied_data[0]
        dt.remove(dt[0])
        temp = [np.mean(analysied_data[1]), np.std(analysied_data[1])]
        P = [np.mean(analysied_data[2]), np.std(analysied_data[2])]
        v_corr = analysied_data[3]
        lp_1 = no_negative_val(dt, analysied_data[4])
        lp_2 = no_negative_val(dt, analysied_data[5])
        lp_3 = no_negative_val(dt, analysied_data[6])
        lp_4 = no_negative_val(dt, analysied_data[7])
        lp_5 = no_negative_val(dt, analysied_data[8])

        #       Graphing
        plt.close()
        plt.scatter(lp_1[0], lp_1[1], label='1st Legendre Polynomial')
        plt.scatter(lp_2[0], lp_2[1], label='2nd Legendre Polynomial')
##        plt.plot(lp_3[0], lp_3[1], label='3rd Legendre Polynomial')
##        plt.plot(lp_4[0], lp_4[1], label='4th Legendre Polynomial')
##        plt.plot(lp_5[0], lp_5[1], label='5th Legendre Polynomial')

        plt.ylabel('Correlation')
        plt.xlabel('Time (s)')
        plt.legend()
        title = 'Orientational Diffusion at ' + str(round(temp[0], 3)) + 'K with a density of ' + str(round(density, 10)) + 'kg/(m^2)'
        plt.title(title)
##        plt.savefig(title + '.png')        

        return [dt, temp, P, v_corr, [lp_1, lp_2, lp_3, lp_4, lp_5]]

def linear_autocorrelation(dt, v_autocorrelation):
        i = 0
        ln_vc = []
        while i < len(v_autocorrelation):
                ln_vc.append([(dt[i] ** 2),
                              np.log(v_autocorrelation[i])])
                i += 1
        return ln_vc


