def rate_of_change(ln_lp_list):
        n = 0
        roc_list = []
        while n < len(ln_lp_list):
                forth_of_list = round(len(ln_lp_list[n][0]) * 1/4)
                three_forth_of_list = round(len(ln_lp_list[n][0]) * 3/4)
                roc_list.append((ln_lp_list[n][three_forth_of_list][-1] - ln_lp_list[n][forth_of_list][-1])/
                                (ln_lp_list[n][three_forth_of_list][0] - ln_lp_list[n][forth_of_list][0]))
                n += 1
        return roc_list

def rate_of_change_v(ln_v_corr):
        forth_of_list = round(len(ln_v_corr[0]) * 1/4)
        three_forth_of_list = round(len(ln_v_corr[0]) * 3/4)
        roc = ((ln_v_corr[three_forth_of_list][-1] - ln_v_corr[forth_of_list][-1])/
                        (ln_v_corr[three_forth_of_list][0] - ln_v_corr[forth_of_list][0]))
        return roc

def analyse_function(sim_data, percentage, title):
        density = density_calculation(percentage)
        formatted_sim_data = Quick_graph_legendre_polynomial(sim_data, density)
        string = title + '.png'
        plt.savefig(str(string))
        plt.close()
        linear_sim_data = linear_legendre_polynomial(formatted_sim_data[4])
        string_linear = title + '_linear.png'
        ln_graph(linear_sim_data, density, formatted_sim_data[1][0])
        plt.savefig(str(string_linear))
        roc = rate_of_change(linear_sim_data)
        return [density, roc]

